var app = angular.module('app', ['ngRoute', 'inscritos']);


app.config(['$routeProvider', function($routeProvider){
	$routeProvider
	.when('/', {
		templateUrl: 'views/index.html',
		controller: 'printController'
	})

}]);

app.controller('printController', ['$scope', '$http', 'factoryInscritos', function($scope, $http, factoryInscritos){
	var imageData = ''	
	$scope.mostrarFicha = false;
	
	function isEmpty(val){
    	return (val === undefined || val == null || val.length <= 0) ? true : false;
	}

	function titular(foto){
		$http.get('http://ccuanexos.herokuapp.com/foto/' + foto)
		.then(function(data){
			var imagem = data.data[0].foto.toString();
			var imageT = document.getElementById('fotoT');
    		imageT.src = "data:image/jpeg;base64," + (imagem || '');
		})
	}

	function auxiliar(foto){
		$http.get('http://ccuanexos.herokuapp.com/foto/' + foto)
		.then(function(data){
			var imagem = data.data[0].foto.toString();
			var imageA = document.getElementById('fotoA');
    		imageA.src = "data:image/jpeg;base64," + (imagem || '');
		})
	}



	$scope.buscar = function() {
		if(!isEmpty($scope.cadastro)){
			if($scope.cadastro.length === 14){
					var promise = factoryInscritos.set($scope.cadastro);
					promise.then(function(inscrito){
					factoryInscritos.setInscrito(inscrito);
					if(!isEmpty(inscrito)){
						$scope.inscrito = factoryInscritos.get();
						var produto = [];
							$scope.produtos = [];
							produto= $scope.inscrito.produto.substring(0, $scope.inscrito.produto.length - 1).split(',');
							produto.forEach( function(value) {
								var obj = {}
								obj.produto = value;
								$scope.produtos.push(obj);
							});
						titular($scope.inscrito.cpf);
						auxiliar($scope.inscrito.cpfPreposto)
						$scope.mostrarFicha = true;
					}else{
						alert('CPF não localizado');
					}
					
				}).catch(function(erro){
					console.log(erro);
				})
			}else {
				alert('CPF incompleto!!!');
			}
		}else{
			alert('cpf inválido!!')
		} 
	}



	function Data(){
		var data = new Date();
		var meses = ['janeiro', 'fevereiro', 'março', 'abril', 'maio', 'junho', 'julho', 'agosto', 'setembro', 'outubro', 'novembro', 'dezembro']
		var semana = ['segunda-feira', 'terça-feira', 'quarta-feira', 'quinta-feira', 'sexta-feira', 'sábado', 'domingo']
		var dia = data.getDate();
		var semana = semana[data.getDay() - 1];
		var mes = meses[data.getMonth()];
		var ano = data.getFullYear();
		var res = 'Rio de Janeiro, ' + semana + ', ' + dia + ' de ' + mes + ' de ' + ano + '.'; 

		return res;
	}

	$scope.data = Data();


	
    

	
	



	$scope.limpar = function(){
		$scope.cadastro = null;
	}

	

	$scope.retornar = function(){
		$scope.inscrito = {}
		$scope.mostrarFicha = false;
		$scope.cadastro = null;
	}

}]);

app.directive('uiCpf', [function(){
	// Runs during compile
	return {
		require: 'ngModel',


		
		link: function(scope, element, attrs, ctrl) {
			function TestaCPF(strCPF) {
			    var Soma;
			    var Resto;
			    Soma = 0;

				if (strCPF == "00000000000") return false;
			    
				for (i=1; i<=9; i++) Soma = Soma + parseInt(strCPF.substring(i-1, i)) * (11 - i);
				Resto = (Soma * 10) % 11;
				
			    if ((Resto == 10) || (Resto == 11))  Resto = 0;
			    if (Resto != parseInt(strCPF.substring(9, 10)) ) return false;
				
				Soma = 0;
			    for (i = 1; i <= 10; i++) Soma = Soma + parseInt(strCPF.substring(i-1, i)) * (12 - i);
			    Resto = (Soma * 10) % 11;
				
			    if ((Resto == 10) || (Resto == 11))  Resto = 0;
			    if (Resto != parseInt(strCPF.substring(10, 11) ) ) return false;
			    return true;
			}


			var formata = function(cpf){
				cpf = cpf.replace(/[^0-9.-]+/g, "");

				if(cpf.length === 3){
					cpf = cpf.substring(0,3) + '.' + cpf.substring(3);
				}

				if(cpf.length === 7){
					cpf = cpf.substring(0,7) + '.' + cpf.substring(7);
				}

				if(cpf.length === 11){
					cpf = cpf.substring(0,11) + '-' + cpf.substring(11,14);
				}

				if(cpf.length === 14){
					if(!TestaCPF(cpf.replace(/[^0-9]+/g, ""))){
						alert('CPF inválido!');
					}
				}

				return cpf;

			}


			element.bind("keyup", function(){
				ctrl.$setViewValue(formata(ctrl.$viewValue));
				ctrl.$render();
			})
		}
	};
}]);